using Paper from './Paper';
using Table from './Table';
using uuid from './Table';

entity Cell {
    key guid: uuid;
    value: String(20);
    row: Integer;
    column: Integer;
    color: Integer;

    createdOn: Timestamp;
    createdBy: String(10);
    toPaper: Association to one Paper on toPaper.name = value;
    toTable: Association to many Table on toTable.guid = guid;
};

using Cell as _Cell from '../db/Cell';
using Table as _Table from '../db/Table';
using Paper as _Paper from '../db/Paper';

service odata {

  entity Cell @(
		title: 'Cell',
		Capabilities: {
			InsertRestrictions: {Insertable: true},
			UpdateRestrictions: {Updatable: true},
			DeleteRestrictions: {Deletable: true}
		}
	) as projection on _Cell;

  entity Paper @(
		title: 'Paper',
		Capabilities: {
			InsertRestrictions: {Insertable: true},
			UpdateRestrictions: {Updatable: true},
			DeleteRestrictions: {Deletable: true}
		}
	) as projection on _Paper;

    entity Table @(
		title: 'Table',
		Capabilities: {
			InsertRestrictions: {Insertable: true},
			UpdateRestrictions: {Updatable: true},
			DeleteRestrictions: {Deletable: true}
		}
	) as projection on _Table;
}

entity Paper {
    key name : String(50);
    description : String(100);
    url: String(100);
    createdOn: Timestamp;
    createdBy: String(10);
};

using Cell from './Cell';

type uuid : String(32);

entity Table {
    key guid : uuid;
    name : String(100);
    description: String(200);
    quantityRow: Integer;
    quantityColumn: Integer;

    createdOn: Timestamp;
    createdBy: String(10);
    toCell : association to many Cell on toCell.guid = guid;
};
